
DROP TABLE IF EXISTS `car_serie`;
CREATE TABLE `car_serie` (
  `id_car_serie` int(11) NOT NULL COMMENT 'ID',
  `id_car_model` int(8) NOT NULL,
  `id_car_generation` int(8) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `date_create` int(10) UNSIGNED DEFAULT NULL,
  `date_update` int(10) UNSIGNED DEFAULT NULL,
  `id_car_type` int(8) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Serie';


DROP TABLE IF EXISTS `car_specification`;
CREATE TABLE `car_specification` (
  `id_car_specification` int(8) NOT NULL COMMENT 'id',
  `name` varchar(255) DEFAULT NULL,
  `id_parent` int(8) DEFAULT NULL,
  `date_create` int(10) UNSIGNED DEFAULT NULL,
  `date_update` int(10) UNSIGNED DEFAULT NULL,
  `id_car_type` int(8) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Specification';


DROP TABLE IF EXISTS `car_specification_value`;
CREATE TABLE `car_specification_value` (
  `id_car_specification_value` int(8) NOT NULL COMMENT 'id',
  `id_car_trim` int(8) NOT NULL COMMENT 'Trim',
  `id_car_specification` int(8) NOT NULL COMMENT 'Specification',
  `value` varchar(255) DEFAULT NULL,
  `unit` varchar(255) DEFAULT NULL COMMENT 'Unit',
  `date_create` int(10) UNSIGNED DEFAULT NULL,
  `date_update` int(10) UNSIGNED DEFAULT NULL,
  `id_car_type` int(8) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Specification value';

